import React from 'react';
import './App.css';
import Post from'./Post'

function App() {
  return (
    <div className="App">
      <div className="app__header">
        <img
          className="app__headerImage"
          src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
          alt=""
         />

      </div>
      <h1> Hello </h1>

        <Post Username imageUrl="https://scontent.fbkk22-2.fna.fbcdn.net/v/t1.0-9/107842421_2667973340129504_2250674154371402536_n.jpg?_nc_cat=106&_nc_sid=09cbfe&_nc_eui2=AeGJPji405iMjnp4F_QeanVQcGcp-AGh_dtwZyn4AaH926HLM1Vnfnntvk8stWVovMD3h-YUlq-s83cM30LLNecW&_nc_ohc=xr9FYA4eqooAX-A7oFa&_nc_ht=scontent.fbkk22-2.fna&oh=e4e60cfdfee02379165550798a27c624&oe=5F7C5C57"/>

        <Post />

        <Post />

    </div>
  );
}

export default App;
